        fun getZpl(fileName: String, activity: Activity, zpl: String, etHigth: String, etWidth: String) {
            val os = activity.openFileOutput(fileName, Activity.MODE_PRIVATE)
            val configLabel = StringBuilder()
            val println = "\n"

            configLabel
                .append("^XA\n")
                .append(println)
                .append("^FO${etHigth},${etWidth}")
                .append(zpl)
                .append("\n")
                .append("^XZ")

            os.write(configLabel.toString().toByteArray())
            os.flush()
            os.close()
        }
    }
